DROP TABLE IF EXISTS `order_info`;
CREATE TABLE `order_info`  (
  `order_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '小程序订单id',
  `hd_order_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '海鼎平台订单id',
  `hd_return_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '海鼎平台退货单id',
  `wx_order_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '微信支付请求订单id',
  `wx_order_no` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '微信支付返回订单号',
  `member_id` bigint(20) NOT NULL COMMENT '会员id',
  `member_name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '会员名称',
  `store_id` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '门店id',
  `store_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '门店名称',
  `total_amount` decimal(10, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT '订单总金额(商品总金额加上包装费)',
  `pay_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '应付金额(实际支付金额)',
  `freight_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '运费金额',
  `coupon_code` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '优惠券码',
  `coupon_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '优惠券抵扣金额',
  `packing_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '包装费金额',
  `return_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '退款金额',
  `promotion_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '促销优惠金额',
  `pay_type` int(1) NULL DEFAULT NULL COMMENT '支付方式: 1-微信;',
  `order_type` int(1) NULL DEFAULT NULL COMMENT '订单类型: 1-正常订单;',
  `status` int(2) NULL DEFAULT NULL COMMENT '订单状态: 0-待付款; 1-支付成功,备货中; 2-等待领取; 3-已完成; 4-未付款取消; 5-出货前取消; 6-支付中; 7-支付失败;  8-退款中; 9-退款成功; 10-退款失败',
  `delivery_status` smallint(2) NULL DEFAULT 0 COMMENT '海鼎备货状态: 0-备货中; 1-已备货',
  `delete_status` int(1) NOT NULL DEFAULT 0 COMMENT '删除状态: 0-未删除; 1-已删除',
  `note` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单备注',
  `payment_time` datetime(0) NULL DEFAULT NULL COMMENT '支付时间',
  `cancel_time` datetime(0) NULL DEFAULT NULL COMMENT '取消时间',
  `cancel_type` smallint(6) NULL DEFAULT NULL COMMENT '取消类型: 1-海鼎备货前取消; 2-海鼎备货后取消; 3-客户收货后取消; 4-海鼎订单创建失败；5-用户手动取消',
  `cancel_reason` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '取消原因',
  `return_reason` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '退货退款原因',
  `water_number` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '优惠券核销流水号',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `meal_code` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '取餐码',
  `finish_time` datetime(0) NULL DEFAULT NULL COMMENT '完成时间',
  `store_code` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '门店编码',
  `use_point` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '订单使用积分',
  `pay_point` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '积分兑换金额',
  `pre_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT 'normal' COMMENT '是否为预约单 normal正常单 dsd预约送达',
  `phone` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '手机号',
  PRIMARY KEY (`order_id`) USING BTREE,
  INDEX `idx_member_id`(`member_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单表' ROW_FORMAT = Dynamic;

