DROP TABLE IF EXISTS `order_return`;
CREATE TABLE `order_return`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `order_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '小程序订单id',
  `hd_return_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '海鼎平台退货单id',
  `wx_refund_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '微信退款请求订单id',
  `wx_refund_no` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '微信退款返回订单号',
  `type` int(11) NULL DEFAULT NULL COMMENT '退货退款状态: 0-整单退; 1-部分退',
  `status` int(1) NULL DEFAULT NULL COMMENT '申请状态: 1-退款中; 2-退款成功; 3-退款失败;',
  `member_id` bigint(20) NOT NULL COMMENT '会员id',
  `member_name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '会员名称',
  `total_return_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '退款总金额',
  `total_return_quantity` int(11) NULL DEFAULT 0 COMMENT '退货总数量',
  `reason` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '退货原因',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `return_by` int(8) NULL DEFAULT NULL COMMENT '退款操作人id',
  `return_by_name` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退款操作人名称',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_hd_return_id`(`hd_return_id`) USING BTREE,
  INDEX `idx_order_id`(`order_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 7 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单退货退款申请表' ROW_FORMAT = Dynamic;

